import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home'; // Ensure the correct path for Home.js
import Login from './components/Login'; // Ensure the correct path for Login.js
import Signup from './pages/Signup'; // Ensure the correct path for Signup.js
import Navbar from './components/Navbar'; // Ensure the correct path for Navbar.js
import Footer from './components/Footer'; // Ensure the correct path for Footer.js
import StudentDashboard from './components/dashboards/StudentDashboard'; // Ensure path
import CompanyDashboard from './components/dashboards/CompanyDashboard'; // Ensure path
import InstituteDashboard from './components/dashboards/InstituteDashboard'; // Ensure path

function App() {
  return (
    <Router>
      <div>
        {/* Navbar */}
        <Navbar />

        {/* Main content with routing */}
        <main>
          <Routes>
            {/* Home page */}
            <Route path="/" element={<Home />} />
            
            {/* Login pages */}
            <Route path="/login/student" element={<Login heading="Student Login" account="Student Login" />} />
            <Route path="/login/company" element={<Login heading="Company Login" account="Company Login" />} />
            <Route path="/login/institute" element={<Login heading="Institute Login" account="Institute Login" />} />
            
            {/* Signup page */}
            <Route path="/signup" element={<Signup />} />

            {/* Dashboard routes based on user type */}
            <Route path="/dashboard/student" element={<StudentDashboard />} />
            <Route path="/dashboard/company" element={<CompanyDashboard />} />
            <Route path="/dashboard/institute" element={<InstituteDashboard />} />
          </Routes>
        </main>

        {/* Footer */}
        <Footer />
      </div>
    </Router>
  );
}

export default App;
